import React, { useEffect, useState } from 'react';
import {
    Box,
    Button,
    TextField,
    FormControl,
    InputLabel,
    Select,
    MenuItem,
} from "@mui/material";
import { Formik, Field, Form, ErrorMessage } from "formik";
import * as yup from "yup";
import useMediaQuery from "@mui/material/useMediaQuery";
import Header from "../../components/Header";
import { useNavigate, useParams } from "react-router-dom";
import axios from "axios";
import { userEndPoint } from "../../data/apiConstants";
import HandleException from "../../util/Toastify";
import { toast } from "react-toastify";
import { passwordRegRxp, phoneRegExp } from "../../util/constants/regex_constants";

const MyForm = () => {
    // ... (existing code)

    const [places, setPlaces] = useState([]);
    const [initialValues, setInitialValues] = useState({
        password: user.password,
        startDestination: "",
        endDestination: "",
    });

    useEffect(() => {
        // Fetch places from your API using Axios
        axios
            .get('your_api_endpoint')
            .then((response) => {
                setPlaces(response.data);
            })
            .catch((error) => {
                console.error('Error fetching places:', error);
            });
    }, []);

    // Define Yup validation schema
    const checkoutSchema = yup.object().shape({
        // ... (existing validation rules)
        startDestination: yup.string().required("Start destination is required"),
        endDestination: yup
            .string()
            .required("End destination is required")
            .notOneOf([yup.ref('startDestination')], 'End destination cannot be the same as start destination'),
    });

    return (
        <Box m="20px">
            {/* ... (existing code) */}
            <Formik
                enableReinitialize={true}
                initialValues={initialValues}
                onSubmit={handleFormSubmit}
                validationSchema={checkoutSchema}
            >
                {({
                      values,
                      errors,
                      touched,
                      handleBlur,
                      handleChange,
                      handleSubmit,
                  }) => (
                    <form onSubmit={handleSubmit}>
                        <Box
                            display="grid"
                            gap="30px"
                            gridTemplateColumns="repeat(4, minmax(0, 1fr))"
                            sx={{
                                "& > div": { gridColumn: isNonMobile ? undefined : "span 4" },
                            }}
                        >
                            {/* ... (existing form fields) */}
                            <FormControl fullWidth>
                                <InputLabel htmlFor="startDestination">
                                    Start Destination
                                </InputLabel>
                                <Field
                                    as={Select}
                                    name="startDestination"
                                    id="startDestination"
                                    onBlur={handleBlur}
                                    onChange={handleChange}
                                    value={values.startDestination}
                                    error={!!touched.startDestination && !!errors.startDestination}
                                >
                                    <MenuItem value="" disabled>
                                        Select a start destination
                                    </MenuItem>
                                    {places.map((place) => (
                                        <MenuItem key={place.id} value={place.id}>
                                            {place.name}
                                        </MenuItem>
                                    ))}
                                </Field>
                                <ErrorMessage
                                    name="startDestination"
                                    component="div"
                                    className="error"
                                />
                            </FormControl>

                            <FormControl fullWidth>
                                <InputLabel htmlFor="endDestination">End Destination</InputLabel>
                                <Field
                                    as={Select}
                                    name="endDestination"
                                    id="endDestination"
                                    onBlur={handleBlur}
                                    onChange={handleChange}
                                    value={values.endDestination}
                                    error={!!touched.endDestination && !!errors.endDestination}
                                >
                                    <MenuItem value="" disabled>
                                        Select an end destination
                                    </MenuItem>
                                    {places.map((place) => (
                                        <MenuItem key={place.id} value={place.id}>
                                            {place.name}
                                        </MenuItem>
                                    ))}
                                </Field>
                                <ErrorMessage
                                    name="endDestination"
                                    component="div"
                                    className="error"
                                />
                            </FormControl>
                        </Box>

                        {/* ... (existing form fields) */}
                    </form>
                )}
            </Formik>
        </Box>
    );
};

export default MyForm;
